import { FormControlLabel, Radio, TextField, Typography } from '@mui/material';
import KeywordRegistStatusList from '../constants/KeywordRegistStatusList';

import Button from '@mui/material/Button'

export default function KeywordCheck(){
      const styles1 = {
        borderBottom:'1px solid black',
        width:'1510px',
        height:'80px',
        // display:'flex',
      };

    return(
        <>
            <div style={styles1}>
                <div style={{width:'250px',height:'50px',backgroundColor:'red',marginTop:'20px',marginLeft:'500px'}}>
                <div style={{marginTop:'45px',fontWeight:'bold',fontSize:'13px',marginLeft:'650px',float:'left'}}>검색: </div>
                <TextField id="outlined-basic" label={<Typography style={{fontSize:'13px',marginTop:'2px'}}>검색어를입력하세유</Typography>} variant="outlined" size="small" style={{marginTop:'30px',marginLeft:'8px',float:'right'}}/>
                </div>
                <div style={{marginLeft:'30px',marginTop:'45px',fontWeight:'bold',fontSize:'13px'}}>작업:</div>
                {KeywordRegistStatusList.map((item)=>(
                    <FormControlLabel value="female" control={<Radio size="small" style= {{marginLeft:'4px'}}/>} label={<Typography style={{fontSize:'13px'}}>{item.text}</Typography>} style={{marginTop:'27px'}} />
                ))}
                <Button variant="outlined" style={{width:'70px',height:'38px',marginTop:'30px'}} color="error">비우기</Button>
                <Button variant="outlined" style={{width:'90px',height:'38px',marginLeft:'10px',marginTop:'30px'}}>검색하기</Button>
            </div>
        </>
    );
}
